import './Friends.css';
import { Context } from '../..';
import { Link, useNavigate, useParams } from 'react-router-dom';

function Frineds() {

  return (
    <div className='friends__wrapper'>
      <div class="friends__heading">
          <h1 class="friends__text">Друзья</h1>
      </div>
      <ul class="friends__list">
        <li class="friends__item friend">
          <img class="friend-avatar" src="/assets/png/user_img.png" alt=""></img>
          <h2 class="friend-name">Иван Иванов</h2>
          <p class="friend-mbti">FFFF</p>
        </li>
      </ul>
    </div>
  );
};

export default Frineds;
